const result = [];
const disabledTimeSlots = [];

const employee = VariablesManager.getValue('selected_master');

for (const item of VariablesManager.getValue('google_appointment_objects')) {
    if (item.employee !== employee) {
        continue;
    }

    let startTimeValue = libs.dayjs(item.start, "MM/DD/YYYY h:mm A");
    const endTimeValue = libs.dayjs(item.finish, "MM/DD/YYYY h:mm A");

    if (startTimeValue.isBefore(libs.dayjs(new Date()))) {
        continue;
    }

    while (startTimeValue.isBefore(endTimeValue)) {
        disabledTimeSlots.push(startTimeValue.format("MM/DD/YYYY h:mm A"));
        startTimeValue = startTimeValue.add(15, 'minute');
    }
}

VariablesManager.setValue("booked_slots", disabledTimeSlots);

let employeeMargo = 0;
let employeeMelena = 0;

for (const item of VariablesManager.getValue('google_appointment_objects')) {
    let startTimeValue = libs.dayjs(item.start, "MM/DD/YYYY h:mm A");
    const endTimeValue = libs.dayjs(item.finish, "MM/DD/YYYY h:mm A");

    if (startTimeValue.isBefore(libs.dayjs(new Date()))) {
        continue;
    }

    while (startTimeValue.isBefore(endTimeValue)) {
        if (item.employee === "Margo") {
            employeeMargo++;
        }
        if (item.employee === "Melena") {
            employeeMelena++;
        }
        startTimeValue = startTimeValue.add(15, 'minute');
    }
}

let selectedEmployee = "Margo";
if (employeeMelena < employeeMargo) {
    selectedEmployee = "Melena";
}

VariablesManager.setValue("selected_master", selectedEmployee);

